import React, { Component } from "react";


import "../pages/Home.css";
import Search from '../component/Search';
import SearchBar from '../component/SearchBar';
import Dropdown from '../component/Dropdown';

function Home() {
  const courses = async () => {
    const ret = await fetch("http://localhost:8080/courses")
    .then(res => {
      if (res.ok) {
        return res.json();
      } else {
        return Promise.reject(res);
      }
    })
    console.log(ret);
    return ret;
  }
  (async () => console.log(await courses()))();
   // any javascript
   return (
    <div className="Home">
    <h1 class = "pad">Scheduler Application</h1>
    <Dropdown/>
    <Search />
    <SearchBar />
    <ul>
      {
        (
          async () => await courses().map(course => {
            <li>{ course.code }</li>
          })
        )()
      }
    </ul>
    </div>
   )
}

export default Home;
